Occasionally I am appalled at how well this simple #rstats palette generator works 

sample_shades &lt;- function(n) {
  sample(colours(distinct = FALSE), n)
}

It feels morally wrong to me that sometimes it is literally this easy #rtistry https://t.co/1VTcLZeDjo

One day leaders in our organizations will be true #DataLeaders and say “yes, give them the data, don’t make them scrape our PDFs”

Until that day, I am very grateful to the creators and maintainers of packages like {tabulizer} &amp; {pdftools}

